import React, { useState } from 'react';
import { SearchNumContaner } from './CardCar.styled';
import Form from 'react-bootstrap/Form';
import "./styles.css"
import Button from 'react-bootstrap/Button';

interface SearchProps {
  onSearch: (number: string) => void;
}

const Search: React.FC<SearchProps> = ({ onSearch }) => {
  const [number, setNumber] = useState('');

  const handleSearch = () => {
    onSearch(number);
  };

  return (
    <SearchNumContaner>
      <Form.Label htmlFor="inputNumber" id="LabelEnterNum">Введите номер</Form.Label>
      <div className='containerSearch'>
        <Form.Control 
          type="text" 
          id="inputNumber" 
          value={number}
          onChange={(e) => setNumber(e.target.value)}
          aria-describedby="numberHelpBlock" 
        />
        <Button variant="success" onClick={handleSearch}>Поиск</Button>
      </div>
      <Form.Text id="numberHelpBlock" className="passwordHelp">
        Номер должен соответствовать регламентам Украины
      </Form.Text>
    </SearchNumContaner>
  );
}

export default Search;
